import React from 'react';

class SearchBar extends React.Component {
  render() {
    return (
      <div className="ui segment">
        <div className="ui form">
          <div className="feild">
            <label htmlFor="search">Video Search</label>
            <input type="text" name="search" />
          </div>
        </div>
      </div>
    );
  }
}

export default SearchBar;
